import React from 'react';

class CurrencyCard extends React.Component {
  render() {
    return (
      <div>
        {this.props.name}
        {this.props.price}
        {this.props.icon}
        {this.props.cap}
      </div>
    );
  }
}

export default CurrencyCard;
